import react from "react";
import { useState, useEffect } from "react";

const MessageUnit = (props) =>{
    const [classname, setClassname] = useState(props.from);
    return(
        <div className="message-unit">
            {
                (classname == "user") ? (<div className="user">{props.content}</div>): (<div className="else">else</div>)
            }
        </div>
    )
}

export default MessageUnit;
